//https://youtube.googleapis.com/youtube/v3/playlistItems?part=snippet%2CcontentDetails&maxResults=25&playlistId=PLBCF2DAC6FFB574DE&key=AIzaSyBK9I7LUg_7JHmSg8QrNhxkwK98MnuOKKQ

class DataHound extends Component {

    constructor() {
        super()
        this.state = {
            url: "",
            data: []
        }
    }

    //Extracts the playlist ID from the URL
    get_playlist_id(URL) {
        //https://www.youtube.com/watch?v=EwdsnGfrd-k&list=PL7RVBKKO9UqyEr8kqLe9152SIktQjDl64
        const num_equal_signs = (URL.match(/=/g) || []).length
        if (URL !== null && num_equal_signs === 1)
            return URL.split("=")[1];
        else if (URL !== null && num_equal_signs === 2)
            return URL.split("=")[2];
        else
            return -1
    }

    //Generatres API URL from playlist ID
    get_api_URL(playlist_ID, key) {
        //AIzaSyBK9I7LUg_7JHmSg8QrNhxkwK98MnuOKKQ
        if (playlist_ID === -1)
            return "No GET address"
        else
            return 'https://youtube.googleapis.com/youtube/v3/playlistItems?part=snippet%2CcontentDetails&maxResults=25&playlistId=' + playlist_ID + '&key=' + key
    }

    //Gets the list of video titles from API call
    get_title_list(get_url) {
        var data = null
        var title_list = []
        fetch(get_url)
            .then((res) => res.json())
            .then((json) => {
                console.log(json)
                //data = json
                //for (var i = 0; i < data.items.length; i++) {
                //    title_list.push(data.items[i].snippet.title)
                //}
                //this.updateData(title_list)
                //return title_list
            })
    }

    updateData(newData) {
        this.setState({
            data: newData
        })
    }

    Hound(url){
        console.log("Starting the Hound")
        console.log("url", url)
        const playlist_id = this.get_playlist_id(url)
        console.log("playlist_id:", playlist_id)
        const api_url = this.get_api_URL(playlist_id)
        console.log("api_url", api_url)
        const title_list = this.get_title_list(api_url)
        console.log("title_list", title_list)
    }


    render() {
        return(
            <div>
                <p>Data is: {this.props.url}</p>
                {this.Hound(this.props.url)}
            </div>
        )
    }
}

export default DataHound
